import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Navbar} from 'react-bootstrap';
import  './Page.css';
import { Link } from "react-router-dom";
import { Button } from 'react-bootstrap';





function LeftNav(){


    return(
        <div>
            <div className="div1-leftnav">



                     <Link className="lien" to="/Lien1">LIEN 1 INTERNE </Link> <br />

                     <Button className="lien"> <Link to="/Lien2">LIEN 2 INTERNE </Link> </Button><br />

                     <Link to="/Lien3">LIEN 3 INTERNE </Link> <br />


                     <Link to="/Lien4">LIEN 4 INTERNE </Link> <br />
                     <div className="div2-leftnav">

<Navbar.Brand href="https://www.wikipedia.com">  LIEN 1 EXTERNE  </Navbar.Brand> <br />


<Navbar.Brand href="https://www.google.com">  LIEN 1 EXTERNE  </Navbar.Brand> <br />


</div>




            </div>


        </div>
      );
      }

export default LeftNav;
